import "../App.css";
import React,{useState,useEffect} from "react";
import "./Logreg.css";

function Login(){
  
  function checkLogin(){
    const userN = document.getElementById("un").value;
    const userP = document.getElementById("pwd").value;
    
  
    console.log("Név: "+userN);
    const [user,setUser]=useState([]);
    const getUser=()=>{
    fetch(`http://localhost:5000/api/user/letolt/${userN}/${userP}`,
      { method: "POST",
        headers: {
        Accept: 'application/json',
        "Content-Type": 'application/json'
        },
    })
      .then(function(response){
      console.log(response)
      return response.json();
    })
    .then(function(myJson) {
      console.log(myJson);
      setUser(myJson)
    });
  }
    useEffect(()=>{
      getUser()
    },[])
  }

    return(
        <form className="page">
          <img id="autolog" src={require("../kepek/log.png")} alt="auto" />
          <div className="reglog1">
            <br /> <br />
            <input type="text" id="un" placeholder="felhasználónév..." name="nev"/><br /><br />
            <input type="password" id="pwd" placeholder="jelszó..." name="password"/><br /><br />
            <button onClick={(e) => checkLogin()} >Login</button>
          </div>
        </form>
    );
}
export default Login;
